    '休':'本宫为坎宫， 休门宜出贵人留，求公干私遇休门，求财参谒贵人钦，欲速同行吉相助，出入嫁娶五福临，休门己见百般食，出入经行得恁强，但求休门门见路，更逢吉利和衷肠。',
    '生':'本宫为艮宫，生门嫁娶远行吉，此门争财见官讼兆，嫁娶避走，二十里见飞鸟来迎之，大吉。但凡出入遇生门，吉曜临之万事成，若有凶神相隔辍，求财所得利称心，生门已见好经营，百事流通得称情，此门出入逢欢喜，但求经营喜气生。',
    '伤':'本宫为震宫，伤门索债必得收，此门出行必见精怪吓、喧事、扭泄、血伤。出入求财如遇伤，更逢吉曜亦难当，跟前人惹疼病祸，自身须防有灾殃，伤门往往是非传，若出门来有祸僽，采捕称心虽是好，其余不得不忧煎。',
    '杜':'本宫为巽宫，杜门藏身可免忧，此门宜出行、谒贵、求财，或遇避者，尅难吉。杜门公用各施行，亦见门中有吉星，茶酒自然留客住，忻欢百事喜相成，杜门曾见好经营，出入从来未称情，若然逃遁如避难，即是元木也不成。',
    '景':'本宫为离宫，景门求财多获利，此门出行见贵、博戏、争逐、捕猎，行四十里，必见喜乐声。远行出入景门中，无尅无生平吉凶，若值星辰方位恶，心头作事亦难通，景门出入且宜良，翫赏嬉中第一强，采猎捕鱼人少得，无忧无喜见安康。',
    '死':'本宫为坤宫，死门捕捉并埋葬，此门宜出猎、张捕、杀生，千死一生，行二十里，路旁必见死伤应之。参谒求谋入死门，吉神刻剥不堪论，若不自身作横事，其人必定见伤痕，死门不可东西去，大抵为名事莫言，死伤求哀为不利，圣人怎肯教胡传。',
    '惊':'本宫为兑宫，惊门遇喜未必通，此门不宜出行、上官，诸事不吉，行六七里，必见惊怪、犬物騐方。寻求走失出惊门，逃人财物尽都存，更得吉星变刑尅，在失逃人自失魂，惊门一定有虚惊，出入如逢百不成，百般美事休更说，往往居家不称情。',
    '开':'本宫为乾宫，开门顺利遍九州，此门宜上官、见贵、出入、求财、回避，三十里必见妇人或穿颜色衣人以应之。开门出入最为良，万事亨通大吉昌，出入求财定见喜，八方干事一齐强，求财出入遇开门，自有欣欢百事成，更值吉星当位照，相逢酒食笑忻忻。',
